// Home Page
import React from "react";
import "../css/Home.css";

function Home() {
    return (
        <div className="HomePage">
            <div className="header">

                <div className="facebook-logo">
                    <div className="logo">
                        <img src="/images/fb-logo.png" alt="logo" style={{height: "50px", padding}}/>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Home;
